CREATE TABLE `productos` (
  `id` int NOT NULL AUTO_INCREMENT,
  `nombre` varchar(100) NOT NULL,
  `nombre_foto` varchar(300) DEFAULT NULL,
  `foto` longblob,
  `descripcion` varchar(300) NOT NULL,
  `costo_unitario` double NOT NULL,
  `precio_venta` double NOT NULL,
  `patente` varchar(20) DEFAULT NULL,
  `id_emprendimiento` int NOT NULL,
  `likes` int DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `fk_productost_emprendimiento1_idx` (`id_emprendimiento`),
  CONSTRAINT `fk_productost_emprendimiento1` FOREIGN KEY (`id_emprendimiento`) REFERENCES `emprendimiento` (`id`) ON DELETE CASCADE
